var RunSlow = flag.Bool("slow", false, "Enable slow tests")

type TestItem struct {
	Value       interface{}
	Checker     Checker
	Expected    interface{}
	Description string
}

type TestSlice []TestItem

func (s TestSlice) Test(c *C) {
	for _, t := range s {
		c.Check(t.Value, t.Checker, t.Expected, Commentf(t.Description))
	}
}

func ErrorCheck(v interface{}, err error) error {
	return err
}

type TestData struct {
	Description string
	Id          string
	Encoded     string
}

func h2b(s string) []byte {
	if b, err := hex.DecodeString(s); err != nil {
		panic(err)
	} else {
		return b
	}
}

func (t *TestData) Bytes() []byte {
	return h2b(t.Encoded)
}

func (t *TestData) NodeId() []byte {
	return h2b(t.Id)
}

func (t *TestData) Reader() *bytes.Reader {
	return bytes.NewReader(t.Bytes())
}

